String.prototype.toHHMMSS = function() {
	var h = parseInt(this, 10);
	var a = Math.floor(h / 3600);
	var b = Math.floor((h - (a * 3600)) / 60);
	var f = h - (a * 3600) - (b * 60);
	if (a < 10) {
		a = "0" + a
	}
	if (b < 10) {
		b = "0" + b
	}
	if (f < 10) {
		f = "0" + f
	}
	var e = a + ":" + b + ":" + f;
	return e
};
